import UserMessage from './usermessage/UserMessage';

const ChatWindow = (args) => {
    const { messages } = args
    console.log(messages);
    return (
        <div>
            { messages.map(m => {
                return <UserMessage key={m} message={m} />
            })}
        </div>
    );
}

export default ChatWindow;
